import React, {useState} from 'react'
import { Button, Divider, Form } from 'semantic-ui-react'

const FormExampleFieldErrorLabel = () => {
  const [form, setValues] = useState({
    username: '',
    email: '',
    password: '',
    confirmPassword: ''
  });

const onChange = (e) => setValues({
  ...form,
  [e.target.name]: e.target.value
})


  const submitHandler = e => {
    e.preventDefault();
    console.log(form)
  }

  return(
  <div className="ui grid">
    <div className="four wide column"></div>
    <div className="eight wide column">

      <Form onSubmit={submitHandler}>
        <Form.Input
          // error={{ content: 'Please enter a user name', pointing: 'below' }}
          fluid
          label='User name'
          name='username'
          placeholder='username'
          type="text"
          value={form.username}
          onChange={(e) => setValues({
            ...form,
            username: e.target.value})}
        />
        <Form.Input
          // error='Please enter your email address'
          fluid
          label='email'
          name='email'
          placeholder='email'
          type="email"
          value={form.email}
          onChange={(e) => setValues({email: e.target.value})}
        />
        <Form.Input
          // error='Please enter password'
          fluid
          label='password'
          email
          placeholder='Password'
          type="password"
          value={form.password}
          onChange={(e) => setValues({password: e.target.value})}
        />
        <Form.Input
          // error='Repeat password here'
          fluid
          label='confirm password'
          placeholder='Confirm password'
          type="password"
          value={form.confirmPassword}
          onChange={(e) => setValues({confirmPassword: e.target.value})}
        />
        <Button type='submit'>Submit</Button>
        <Divider hidden />
      </Form>
    </div>
    <div className="four wide column"></div>
  </div>
  )
}

export default FormExampleFieldErrorLabel
